import './App.css';
import React from 'react';
import { Layer, Rect, Stage } from 'react-konva';

class Block extends React.Component{
  render(){
    return(
      <Rect
        x={50} y={50} width={100} height={100}
        fill='green'
      />
    );
  }
}

function App() {
  return (
    <Stage>
      <Layer>
        <Block />
      </Layer>
    </Stage>
  );
}

export default App;
